  (26014, 443, 'NEW 2017 Professional Level Winmau Blade 5 FIVE Dart Board BEST English quality', 'Winmau Professional Blade 5 Dart Board. Winmau Blade 5 Dart Board. Only for the professional player. The Blade 5 pushes the boundaries of dartboard technology to its limits. The new wiring system allows for 9mm² extra scoring area in the doubles.', '279.02', 7, 'New', 'ForSale'),
