  (26021, 7, 'Premium 6pcs 24g Chrome-plated Brass Tips Alu Barrel Storage Box  Camborne BOX', '24g Chrome-plated Brass Tips Alu Barrel Darts. 24g Chrome-plated Brass Tipped Darts. Material: Chrome-plated brass tip, aluminum barrel. Comes with storage box. 6x Brass Tipped Darts. BSB: 112-879 062-184.', '35.99', 7, 'New', 'Wanted'),
