  (26040, 130, 'WINMAU SIMON WHITLOCK Steel Tip BRASS Dart Board DARTS Christmas -  22 or 24gram', 'WINMAU SIMON WHITLOCK BRASS DARTS - 20, 22, or 24 gram. these BRASS darts are replicas of his unique barrel design. Simon Whitlock - the darting wizard who blew the roof off the Alexandra. Options Available: 22 or 24gm.', '24.95', 7, 'New', 'ForSale'),
  (26041, 144, 'Target Pixel Power Shaft Generation 2 - Pinch Grip - Dart Stems / Shafts & Tops', 'Adding Pixel grip to the shafts gives added reassurance and new options to holding your darts. This is for 1 set of 3 dart stems / shafts or for 1 set of 3 aluminium spare tops. The Pixel Titanium Shaft grips the flight tighter as the top in screwed in; the design also allows the aluminium tops to be replaced quickly and conveniently if you need to change flights mid game.', '3.30', 9, 'New', 'Wanted'),
  (26042, 434, '3pcs Darts Magnetic Darts Game Plastic Red + Green + Yellow CR D7N4 V6Q6', '3 magnetic darts has flat points Advanced ultra powerful magnetic All the fun of darts will not be poking holes in the wall Good replacements or spare for the game of darts Material: Plastic   metal magnetic This set of three magnetic darts is a safer alternative to regular darts. You do not need to worry about anyone who is spear with the tip of an arrow, like magnetic darts are not sharp at all. All you need now is a game of darts which is compatible with magnets, and you are ready to play! Color: Red   Green   Yellow Length: approx. 3.15 inches / 8 cm The package includes: 1 package of magnetic darts (3Pcs) Note:Light shooting and different displays may cause the color of the item in the picture a little different from the real thing.The measurement allowe.', '1.68', 5, 'New', 'ForSale'),
