  (26047, 317, '6 PCs Aluminum Darts 2ba Shafts 6 Colors Medium Harrows Dart Stems Throwing', '6pcs Aluminum Throwing Darts (Choose the color you like). Material: Aluminium Alloy. color engraved aluminum alloy rod, not broken, not folded. All pictures are for illustration purpose only and Colours may vary slightly.', '1.00', 6, 'New', 'Wanted'),
  (26048, 42, 'Steel Copper Needle Tip Dart Darts With Nice Flight Flights Throwing Toy Best AU', 'Steel tip darts With nice flights. A skillful adult game. Not a child''s toy or for use by children. Material: Copperize Barrel Needle Darts. The darts are designed with metal leads and plastic body.', '1.00', 4, 'New', 'ForSale'),
  (26049, 154, 'Ruthless V 100 Pro Extra Strong Kite Flights (Choose you colour) – NEW RELEASE', 'These new release Ruthless V 100 Pro flights are the latest in their range of extra strong flights. Each flight is printed on a transparent background with black panels and clear panels, the latter saying ruthless in black writing.', '1.40', 4, 'New', 'Wanted'),
  (26050, 352, 'Innova Valkyrie Disc Golf Driver, Colour & Plastic Options. Aussie Stock!', 'In lighter weights gives new players extra distance. Lighter weights also give players extreme range when thrown downwind, while maximum weights can give excellent upwind distance. The Valkyrie’s high speed turn and flight characteristics make it great choice for long range turnover shots and rollers.', '22.00', 9, 'New', 'ForSale'),
  (26051, 234, 'Innova Shryke Disc Golf Distance Driver, Colour & Plastic Options. Aussie Stock!', 'The Shryke is an easy to throw, very long range driver for a wide variety of players. A mild high speed turn puts the Shryke in glide mode, which along with its high aerodynamic speed, give it incredible distance.', '25.00', 0, 'New', 'Wanted'),
  (26052, 117, 'Kastaplast Berg Disc Golf Putter K1, K2 & K3 and Colour Options. Aussie Stock!', 'The Kastaplast Berg is a slow and stable Disc Golf Putter designed for short drives and approaches, as well as fearless putts! Berg features an ergonomic grip. Feel the Berg-difference and go for the chains!', '20.00', 1, 'New', 'ForSale'),
  (26053, 300, 'Kastaplast Reko Disc Golf Putter K1& K3 and Colour Options. Aussie Stock!', 'The Kastaplast Berg is made for those straight putts and approaches. Give it a little hyzer on drives and watch it turn over gently. The Kastaplast Reko has all the qualities of a true go-to putter.', '20.00', 8, 'New', 'Wanted'),
  (26054, 229, 'Kastaplast Falk Disc Golf Fairway Driver K1, Colour Options. Aussie Stock!', 'This versatile fairway driver fits the skills and power of a wide range of players. Falk loves tailwinds and long anhyzer lines. It loves to fly! With a comfortable grip and a rim width at 19 mm the Falk suits most hands and styles.', '25.00', 5, 'New', 'ForSale'),
  (26055, 48, 'Kastaplast Grym Disc Golf Distance Driver K1, Colour Options. Aussie Stock!', 'The Grym is designed for long smooth s-curves and tailwind bombs. A distance driver with a clean shape and a comfortable 2,2 cm rim. This disc is a big D driver for the common player. Grym is Swedish for cruel or awesome – try it out for some grym lines!', '25.00', 4, 'New', 'Wanted'),
  (26056, 387, 'Kastaplast Grym X Disc Golf Distance Driver K1, Colour Options. Aussie Stock!', 'The Grym X is a stable distance driver that provides a well-balanced combination of accuracy and glide. It is designed to be the solid and dependable main driver that experienced players are asking for.', '25.00', 7, 'New', 'ForSale'),
  (26057, 3, 'Kastaplast Kaxe Disc Golf Midrange K1, K2 & K3, Colour Options. Aussie Stock!', 'This disc is appreciated for its predictable flight and will come in handy in numerous situations on the course. Due to its slim proportions and decent stability, Kaxe handles wind well without being very overstable.', '20.00', 9, 'New', 'Wanted'),
  (26058, 44, 'Kastaplast Kaxe Z Disc Golf Midrange K1, K2 & K3, Colour Options. Aussie Stock!', 'This disc is essentially a beadless Kaxe. Just as with the original Kaxe we have called it a midrange driver, but Kaxe Z is just as much a fairway driver. With this disc we’re introducing the Z as in Zero, symbolizing less stability than the original mold.', '20.00', 7, 'New', 'ForSale'),
  (26059, 182, 'Kastaplast Rask Disc Golf Distance Driver K1, Colour Options. Aussie Stock!', 'TheRask is a concept disc is based on Kastaplast’s invention for drag reduction. It’s the most streamlined disc to date. A good powerful rip and it will have the job done in no time. Rask needs a lot of speed to fly, making it best suitable for power throwers and experienced players.', '25.00', 5, 'New', 'Wanted'),
  (26060, 472, 'RPM Discs - Ruru - Disc Golf Putter. Plastic and Colour Options. Aussie Stock!', 'The Ruru or (Morepork) is RPM’s dedicated Putter and named after a NZ native owl. The flight is slow and consistent, stable with a very small late fade. The Ruru has a small bead and a deep Rim and comes in 4 different plastic types and with many effects.', '19.00', 0, 'New', 'ForSale'),
  (26061, 386, 'RPM Discs Tui Disc Golf Putt Approach. Plastic and Colour Options. Aussie Stock!', 'This is an excellent utility putt and approach disc. With a strong throw the Tui will hold a turnover and won’t fade back. RPM Discs - Tui. Tui in traditional flight specs: 3/4/-1/0.', '19.00', 8, 'New', 'Wanted'),
  (26062, 272, 'RPM Discs Piwakawaka Disc Golf Midrange. Plastic & Colour Options. Aussie Stock!', 'RPM Discs - Piwakawaka. The fantail is one of the few native bird species in New Zealand that has been able to adapt to an environment greatly altered by humans. Originally a bird of open native forests and scrub, it is now also found in exotic plantation forests, in orchards and in gardens.', '19.00', 8, 'New', 'ForSale'),
  (26063, 215, 'RPM Discs Kahu Disc Golf Distance Driver Plastic & Colour Options. Aussie Stock!', 'The Kahu is a great high speed driver with gentle turn good glide and a hard fade. It is also a good forehand disc. RPM Discs - Kahu. Kāhu is the Māori name for the New Zealand Swamp Harrier, a large, tawny-brown bird of prey that occurs throughout New Zealand.', '23.00', 8, 'New', 'Wanted'),
  (26064, 295, 'RPM Discs Taniwha Disc Golf Driver Plastic & Colour Options. Aussie Stock!', 'The taniwha Tūtaeporoporo began life as a shark. A chief caught him and kept him as a pet in a river. Then Tūtaeporoporo changed, growing scaly skin, wings, webbed feet and a bird-like head. He began eating people travelling on the river.', '23.00', 0, 'New', 'ForSale'),
  (26065, 297, 'Wham-O Mini Disc Golf Basket 4 Pack With Mini Frisbees. Delivery is Free', 'The game of disc golf has just gotten much smaller. The scale model Wham-O Trapper target weighs in at 0.9kg is very brightly coloured and comes with six mini Frisbees. You''ll also find instructions for several games to play.', '289.00', 9, 'New', 'Wanted'),
